import React, { useState } from 'react'
import ReactDOM from 'react-dom'
import products from './productslist'

function CreateProducts() {
    sessionStorage.removeItem("selectedProduct")

    const [selectedProduct, setSelectedProducte] = useState([])

    function setSelectedProduct(e) {
        for(let i = 0; i < products.length; i++) {
            if (e.target.alt === products[i].alt) {
                selectedProduct.push(products[i])
                sessionStorage.setItem("selectedProduct", JSON.stringify(selectedProduct))
            }
        }
    }

    return  <>
    {products.map((product) => (
        <li className='product' key={product.id}>
            <img src={"./img/" + (product.image[0])} alt={product.alt} className='images' id={product.id} onClick={setSelectedProduct} />
            <div className='name'>{product.name}</div>
            <div className='price'>{product.price}</div>
        </li>
    ))}
    </>

}


export {CreateProducts}
